import React from 'react';
import styles from './Footer.css';

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <div className={styles.contents}>
        <h2 className={styles.title}>Kim NaYoung</h2>
      </div>
    </footer>
  )
}

export default Footer
